static String str(List commits) {
  StringBuilder sb = new StringBuilder();
  sb.append("num=").append(commits.size());

  for (IndexCommit commit : (List<IndexCommit>) commits) {
    sb.append("\n\t");
    sb.append(str(commit));
  }
  return sb.toString();
}

